insert  into `wp_options`(`option_id`,`option_name`,`option_value`,`autoload`) values (159,'_transient_acf_plugin_info_pro','a:18:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:5:\"5.9.5\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:64:\"<a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:3:\"4.7\";s:12:\"requires_php\";s:3:\"5.6\";s:6:\"tested\";s:3:\"5.6\";s:5:\"added\";s:10:\"2014-07-11\";s:12:\"last_updated\";s:10:\"2021-02-11\";s:11:\"description\";s:1349:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! <a href=\"https://www.advancedcustomfields.com/pro/\">Learn more</a></p>\";s:12:\"installation\";s:503:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li><strong>Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:5158:\"<h4>5.9.5</h4>\n<p><em>Release Date - 11 February 2021</em></p>\n\n<ul>\n<li>Fix - Fixed regression preventing blocks from loading correctly within the editor in WordPress 5.5.</li>\n<li>Fix - Fixed bug causing incorrect post_status properties when restoring a Field Group from trash in WordPress 5.6.</li>\n<li>Fix - Fixed edge case bug where a taxonomy named \"options\" could interfere with saving and loading option values.</li>\n<li>Fix - Fixed additional PHP 8.0 warnings.</li>\n<li>i18n - Updated Finnish translation thanks to Mikko Kekki</li>\n</ul>\n\n<h4>5.9.4</h4>\n<p><em>Release Date - 14 January 2021</em></p>\n\n<ul>\n<li>Enhancement - Added PHP validation for the Email field (previously relied solely on browser validation).</li>\n<li>Fix - Added support for PHP 8.0 (fixed logged warnings).</li>\n<li>Fix - Added support for jQuery 3.5 (fixed logged warnings).</li>\n<li>Fix - Fixed bug causing WYSIWYG field to appear unresponsive within the Gutenberg editor.</li>\n<li>Fix - Fixed regression preventing \"blog_%d\" and \"site_%d\" as valid <code>$post_id</code> values for custom Taxonomy terms.</li>\n<li>Fix - Fixed bug causing Radio field label to select first choice.</li>\n<li>Fix - Fixed bug preventing preloading blocks that contain multiple parent DOM elements.</li>\n<li>i18n - Updated Japanese translation thanks to Ryo Takahashi.</li>\n<li>i18n - Updated Portuguese translation thanks to Pedro Mendonça.</li>\n</ul>\n\n<h4>5.9.3</h4>\n<p><em>Release Date - 3 November 2020</em></p>\n\n<ul>\n<li>Fix - Fixed bug causing Revision meta to incorrectly update the parent Post meta.</li>\n<li>Fix - Fixed bug breaking \"Filter by Post Type\" and \"Filter by Taxonomy\" Field settings.</li>\n</ul>\n<p>* Added toolbar across all ACF admin pages.</p>\n<p>* Added new table columns: Description, Key, Location, Local JSON.</p>\n<p>* Added popup modal to review Local JSON changes before sync.</p>\n<p>* Added visual representation of where Field Groups will appear.</p>\n<p>* Added new help tab.</p>\n<p>* Simplified layout.</p>\n<ul>\n<li>Enhancement - New ACF Blocks features.</li>\n</ul>\n<p>* Added support for Inner Blocks.</p>\n<p>* Added new \"jsx\" setting.</p>\n<p>* Added new \"align_text\" settings.</p>\n<p>* Added new \"align_content\" settings.</p>\n<ul>\n<li>Enhancement - Added duplicate functionality for Repeater and Flexible Content fields.</li>\n<li>Enhancement - Added PHP validation support for Gutenberg.</li>\n<li>Enhancement - Added ability to bypass confirmation tooltips (just hold shift).</li>\n<li>Enhancement - Local JSON files now save back to their loaded source path (not \"save_json\" setting).</li>\n<li>Tweak - Replaced all custom icons with dashicons.</li>\n<li>Tweak - Changed custom post status label from \"Inactive\" to \"Disabled\".</li>\n<li>Tweak - Improved styling of metaboxes positioned in the block editor sidebar.</li>\n<li>Fix - Improved AJAX request efficiency when editing block className or anchor attributes.</li>\n<li>Fix - Fixed bug causing unresponsive WYSIWYG fields after moving a block via the up/down arrows.</li>\n<li>Fix - Fixed bug causing HTML to jump between multiple instances of the same Reusable Block.</li>\n<li>Fix - Fixed bug sometimes displaying validation errors when saving a draft.</li>\n<li>Fix - Fixed bug breaking Image field UI when displaying a scaled portrait attachment.</li>\n<li>Fix - Fixed bug in Link field incorrectly treating the \"Cancel\" button as \"Submit\".</li>\n<li>Fix - Fixed bug where a sub field within a collapsed Repeater row did not grow to the full available width.</li>\n<li>Fix - Ensured all archive URLs shown in the Page Link field dropdown are unique.</li>\n<li>Fix - Fixed bug causing incorrect conditional logic settings on nested fields when duplicating a Field Group.</li>\n<li>Fix - Fixed bug causing license activation issues with some password management browser extensions.</li>\n<li>Dev - Major improvements to <code>ACF_Location</code> class.</li>\n<li>Dev - Refactored all location classes to optimize performance.</li>\n<li>Dev - Extracted core JavaScript from \"acf-input.js\" into a separate \"acf.js\" file.</li>\n<li>Dev - Field Group export now shows \"active\" attribute as bool instead of int.</li>\n<li>Dev - Added filter \"acf/get_object_type\" to customize WP object information such as \"label\" and \"icon\".</li>\n<li>Dev - Added action \"acf/admin_print_uploader_scripts\" fired when printing uploader (WP media) scripts in the footer.</li>\n<li>Dev - Added filters \"acf/pre_load_attachment\" and \"acf/load_attachment\" to customize attachment details.</li>\n<li>Dev - Added filter \"acf/admin/toolbar\" to customize the admin toolbar items.</li>\n<li>Dev - Added new JS actions \"duplicate_fields\" and \"duplicate_field\" fired when duplicating a row.</li>\n<li>i18n - Changed Croatian locale code from \"hr_HR to \"hr\".</li>\n<li>i18n - Updated Portuguese translation thanks to Pedro Mendonça.</li>\n<li>i18n - Updated French Canadian translation thanks to Bérenger Zyla.</li>\n<li>i18n - Updated French translation thanks to Maxime Bernard-Jacquet.</li>\n<li>i18n - Updated German translations thanks to Ralf Koller.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:77:\"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.jpg?rev=1729102\";s:4:\"high\";s:78:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg?rev=1729099\";}s:8:\"versions\";a:122:{i:0;s:5:\"5.9.4\";i:1;s:5:\"5.9.3\";i:2;s:5:\"5.9.2\";i:3;s:5:\"5.9.1\";i:4;s:11:\"5.9.0-beta5\";i:5;s:11:\"5.9.0-beta4\";i:6;s:11:\"5.9.0-beta3\";i:7;s:11:\"5.9.0-beta2\";i:8;s:11:\"5.9.0-beta1\";i:9;s:9:\"5.9.0-RC1\";i:10;s:5:\"5.9.0\";i:11;s:5:\"5.8.9\";i:12;s:5:\"5.8.8\";i:13;s:5:\"5.8.7\";i:14;s:5:\"5.8.6\";i:15;s:5:\"5.8.5\";i:16;s:5:\"5.8.4\";i:17;s:5:\"5.8.3\";i:18;s:5:\"5.8.2\";i:19;s:6:\"5.8.14\";i:20;s:6:\"5.8.13\";i:21;s:6:\"5.8.12\";i:22;s:6:\"5.8.11\";i:23;s:5:\"5.8.1\";i:24;s:13:\"5.8.0-beta4.1\";i:25;s:11:\"5.8.0-beta4\";i:26;s:11:\"5.8.0-beta3\";i:27;s:11:\"5.8.0-beta2\";i:28;s:11:\"5.8.0-beta1\";i:29;s:9:\"5.8.0-RC2\";i:30;s:9:\"5.8.0-RC1\";i:31;s:5:\"5.8.0\";i:32;s:5:\"5.7.9\";i:33;s:5:\"5.7.8\";i:34;s:5:\"5.7.7\";i:35;s:5:\"5.7.6\";i:36;s:5:\"5.7.5\";i:37;s:5:\"5.7.4\";i:38;s:5:\"5.7.3\";i:39;s:5:\"5.7.2\";i:40;s:6:\"5.7.13\";i:41;s:6:\"5.7.12\";i:42;s:6:\"5.7.10\";i:43;s:5:\"5.7.1\";i:44;s:5:\"5.7.0\";i:45;s:5:\"5.6.9\";i:46;s:5:\"5.6.8\";i:47;s:5:\"5.6.7\";i:48;s:5:\"5.6.6\";i:49;s:5:\"5.6.5\";i:50;s:5:\"5.6.4\";i:51;s:5:\"5.6.3\";i:52;s:5:\"5.6.2\";i:53;s:6:\"5.6.10\";i:54;s:5:\"5.6.1\";i:55;s:11:\"5.6.0-beta2\";i:56;s:11:\"5.6.0-beta1\";i:57;s:9:\"5.6.0-RC2\";i:58;s:9:\"5.6.0-RC1\";i:59;s:5:\"5.6.0\";i:60;s:5:\"5.5.9\";i:61;s:5:\"5.5.7\";i:62;s:5:\"5.5.5\";i:63;s:5:\"5.5.3\";i:64;s:5:\"5.5.2\";i:65;s:6:\"5.5.14\";i:66;s:6:\"5.5.13\";i:67;s:6:\"5.5.12\";i:68;s:6:\"5.5.11\";i:69;s:6:\"5.5.10\";i:70;s:5:\"5.5.1\";i:71;s:5: