insert  into `wp_postmeta`(`meta_id`,`post_id`,`meta_key`,`meta_value`) values (112,145,'title_description','<p>Africa and Gulf Bank (AGB) and its affiliates are committed to providing the highest level of protection regarding the processing of their customers’ personal data based on applicable data protection laws and regulations.</p>\r\n        <p>This policy describes how Africa and Gulf Bank (AGB) as head office in Sudan and its concerned affiliate(s) – when you are dealing with a local AGB affiliate - may collect, use, store, disclose or otherwise process your personal data including personal data provided when using our websites (“AGB Websites”).</p>\r\n        <p>Personal data comprises all the details that AGB collects and processes directly or indirectly about you as an individual client or representative of a corporate client, for instance information about your identity and contact details (such as name, email id, contact number), your transactions, your financial information, interactions, or dealings with AGB, including information received from third parties and information collected through use of AGB Websites, cookies or other similar tools and our electronic banking services The use of the AGB Websites and any products and services supplied are subject to our Terms and Conditions.</p>\r\n        <p>For more information about our use of cookies please refer to our Cookie Policy.</p>');
