insert  into `wp_postmeta`(`meta_id`,`post_id`,`meta_key`,`meta_value`) values (2349,139,'title_description','<p>The website agb.com is an official website owned by Africa and Gulf Bank (AGB). You should read all these terms and conditions carefully before using this website. Using the website indicates that you accept these terms. If you do not accept these terms, do not use the website. You should also read the terms and conditions about each product and service on the website as set out below:</p><ul><li>Unless otherwise stated, the copyright, trademarks and other intellectual property rights in all the material on the website (including without limitation text, tools, photographs and graphical images) are owned by AGB and/or its licensors. You may not reproduce or adapt the website in whole or in part without our prior written consent, except for the purpose of accessing our products and/or services and for producing print-outs for your own personal and non-commercial purposes. Any unauthorized use or reproduction of the information, materials and proprietary rights contained in the website is strictly prohibited.</li><li>The information on this website is provided for general information only and should not be used as a basis for making business decisions or claims. AGB makes no warranties or representations as to the accuracy, adequacy or completeness of the information contained on the website. The information and materials on this website and the terms, conditions and descriptions that appear are subject to change without notice.</li><li>Any links to third party websites are provided solely for information purpose and your convenience. AGB has not reviewed all these third party websites, does not control, and is not responsible for their content or availability. AGB\'s inclusion of these hyperlinks does not imply any endorsement of the information or material on any such website.</li><li>The terms and conditions for specific products and services are set out