insert  into `wp_postmeta`(`meta_id`,`post_id`,`meta_key`,`meta_value`) values (2371,159,'title_description','<p>AGB pledges to commit the necessary resources to protect the personal safety of our staff and customer, while maintaining the services our customers rely on. Though COVID-19 and the subsequent lockdown has affected the way we work, the way we bank and how we interact with each other, we want you to know we are in this together. As we continue to recover from the effects of the COVID-19 pandemic, AGB will continue to make appropriate amendments to banking operations to ensure the safety of our employees, customers, and partners.</p>');
